//    retArr[2]    : 기둥형태코드
//    retArr[3]    : 기둥형태명
//    retArr[4]    : 외벽형태코드
//    retArr[5]    : 외벽형태명
//    retArr[6]    : 지붕형태코드
//    retArr[7]    : 지붕형태명
//
//
