var PoleTypeCd;	// 기둥형태코드 
var ExtrnWlTypeCd;	// 외벽형태코드
var RoofTypeCd;	// 지붕형태코드

//========================================================//
//========================================================//
// 초기 OnLoad 영역
//========================================================//
//---------------------------------------------------------------------------
// function 명 : FORM_OnLoadCompleted(obj)
// 내용        : FORM OnLoad
//---------------------------------------------------------------------------
scwin.init = function() {
	var pro = Promise.resolve();
		window.top.util.winTopShowModalChk = "T";
		util.winTopShowModal();
	pro = pro.then(function(rv) {
    	return util.winTopShowModalPromise();
	}); 
	pro = pro.then(function(rv) {
     //init 부분 함수 입력하는곳
	wprom.setPopupInit(896, 623, "건물구조급수");
	console.log("[/CBSC024P.xml] [init()] ==> [구조급수] [TEST_01]" );

//	"PoleTypeCd" : Ds_Prprt_Appl.getCellData(Ds_Prprt_Appl.rowposition, "sPoleTypeCd")	//기둥형태코드
//				, "ExtrnWlTypeCd" : Ds_Prprt_Appl.getCellData(Ds_Prprt_Appl.rowposition, "sExtrnWlTypeCd")		// 외벽형태코드  
//				, "RoofTypeCd" : Ds_Prprt_Appl.getCellData(Ds_Prprt_Appl.rowposition, "sRoofTypeCd")	// 지붕형태코드   
//				
	var indata = $w.getParameter("param");
	var inJSON = JSON.parse(indata); 	// 부모창에서 받아온 값( 예) inJSON.sMyPlan) applyEnable

	if (!util.isNull(inJSON.PoleTypeCd)) 	PoleTypeCd = inJSON.PoleTypeCd;	 ///기둥형태코드
	if (!util.isNull(inJSON.ExtrnWlTypeCd)) 	ExtrnWlTypeCd = inJSON.ExtrnWlTypeCd;	 // 외벽형태코드 	
	if (!util.isNull(inJSON.RoofTypeCd)) 	RoofTypeCd = inJSON.RoofTypeCd;	 // 지붕형태코드 		

	//var indata = $w.getParameter("param");//

//	try {
//		  fv_args = JSON.parse(indata);
//		  PoleTypeCd = fv_args.PoleTypeCd;
//		  ExtrnWlTypeCd = fv_args.ExtrnWlTypeCd;
//		  RoofTypeCd = fv_args.RoofTypeCd;
//	} catch(e) {
//	};
    // 파라메터
    //trace("param ====> " + PoleTypeCd + "::" + ExtrnWlTypeCd + "::" + RoofTypeCd);

	console.log("[/CBSC024P.xml] [init()] ==> [구조급수] [TEST_01] [PoleTypeCd]"+ PoleTypeCd +"[ExtrnWlTypeCd]"+ ExtrnWlTypeCd +"[RoofTypeCd]"+ RoofTypeCd );

    // 초기값 설정
    scwin.lfn_initDataset();

    // 건물급수 설정
    scwin.lfn_BuldgGradEsbl();

        return ;		// init 함수를 종료하고자 할때 사용
		// return Promise.reject("오류관련처리"); 
	});
	pro = pro.then(function(rv) {
		util.winTopHideModal();
	});	
	pro = pro.catch(function(rj) {
		util.winTopHideModal();
		//alert(rj); //Promise reject 시 처리 "오류관련처리" 값출력
	});	 
	return pro; 
};

//---------------------------------------------------------------------------
// function 명 : lfn_initDataset()
// 내용        : 초기값 설정
//---------------------------------------------------------------------------
scwin.lfn_initDataset = function() {
    if (wconv.trim(PoleTypeCd) != "")
        eval("div_PoleTypeCd_chk_PoleTypeCd_" + PoleTypeCd).setValue(true);
    if (wconv.trim(ExtrnWlTypeCd) != "")
        eval("div_ExtrnWlTypeCd_chk_ExtrnWlTypeCd_" + ExtrnWlTypeCd).setValue(true);
    if (wconv.trim(RoofTypeCd) != "")
        eval("div_RoofTypeCd_chk_RoofTypeCd_" + RoofTypeCd).setValue(true);
};

//========================================================//
//========================================================//
// 자체 이벤트 영역
//========================================================//
//---------------------------------------------------------------------------
// function 명 : div_PoleTypeCd_chk_PoleTypeCd_OnClick(obj)
// 내용        : 기둥형태 OnClick
//---------------------------------------------------------------------------
scwin.div_PoleTypeCd_chk_PoleTypeCd_onviewchange = function(info) {
    var sNum;
    for (var i = 1; i <= 6; i++) {
        sNum = i + "";
        if (sNum.length < 2)
            sNum = "0" + sNum;
        if (this.id == ("div_PoleTypeCd_chk_PoleTypeCd_" + sNum)) {
            this.setValue(true);
            PoleTypeCd = sNum;
            continue;
        }
        eval("div_PoleTypeCd_chk_PoleTypeCd_" + sNum).setValue(false);
    }
    // 건물급수 설정
    scwin.lfn_BuldgGradEsbl();
};

//---------------------------------------------------------------------------
// function 명 : div_PoleTypeCd_img_PoleTypeCd_OnClick(obj,nX,nY)
// 내용        : 기둥형태 이미지 OnClick
//---------------------------------------------------------------------------
scwin.div_PoleTypeCd_img_PoleTypeCd_OnClick = function(e) {
	// var strObjectID = "div_PoleTypeCd." + Replace(obj.ID, "img_", "chk_");
	var strObjectID = this.id.replace( "img_", "chk_");
   	var sNum;
    for (var i = 1; i <= 6; i++) {
        sNum = i + "";
        if (sNum.length < 2)
            sNum = "0" + sNum;
        if (strObjectID == ("div_PoleTypeCd_chk_PoleTypeCd_" + sNum)) {
        	eval(strObjectID).setValue(true);
            PoleTypeCd = sNum;
            continue;
        }
        eval("div_PoleTypeCd_chk_PoleTypeCd_" + sNum).setValue(false);
    }


    // 건물급수 설정
    scwin.lfn_BuldgGradEsbl();
};

