//---------------------------------------------------------------------------
// function 명 : btn_apply_OnClick(obj)
// 내용        : 적용 OnClick
//---------------------------------------------------------------------------
scwin.btn_apply_OnClick = function(e) {
	console.log("[/CBSC024P.xml] [btn_apply_OnClick()] ==> [적용] [TEST_01] [ds_BuldgGrad.getTotalRow()]"+ ds_BuldgGrad.getTotalRow() );

    // 업종 선택 체크
    if (ds_BuldgGrad.getTotalRow() < 0) {    	
        wprom.alert("건물구조급수가 없습니다!");
        return;
    }

    var retArr = new Array();
    var i = 0; 
    retArr[i++] = ds_BuldgGrad.getCellData(0, "BuldgStrtGrad"); // 건물구조등급코드
    retArr[i++] = ds_BuldgGrad.getCellData(0, "BuldgStrtGradName"); // 건물구조등급명
    retArr[i++] = PoleTypeCd; // 기둥형태코드 
    retArr[i++] = eval("div_PoleTypeCd_chk_PoleTypeCd_" + PoleTypeCd).getText(); // 기둥형태명 
    retArr[i++] = ExtrnWlTypeCd; // 외벽형태코드
    retArr[i++] = eval("div_ExtrnWlTypeCd_chk_ExtrnWlTypeCd_" + ExtrnWlTypeCd).getText(); // 외벽형태명
    retArr[i++] = RoofTypeCd; // 지붕형태코드
    retArr[i++] = eval("div_RoofTypeCd_chk_RoofTypeCd_" + RoofTypeCd).getText(); // 지붕형태명
    //alert(retArr);    
    console.log("[/CBSC024P.xml] [btn_apply_OnClick()] ==> [적용] [TEST_end] [retArr]"+ retArr );

    wprom.close(retArr);
};

