//---------------------------------------------------------------------------
// function 명 : lfn_BuldgGradEsbl
// 내용        : 건물급수 설정
//---------------------------------------------------------------------------
scwin.lfn_BuldgGradEsbl = function() {

    if (wconv.trim(PoleTypeCd) == "" || wconv.trim(ExtrnWlTypeCd) == "" || wconv.trim(RoofTypeCd) == "") {
        util.setRowPosition(ds_BuldgGrad, 0);
        /*수작업변환가이드(테스트)
        global dataList인 경우에는 gds.을 붙여주세요.
        예시)util.setRowPosition(gds.gDs_ServerTime, 1); */
        wconv.filter(ds_BuldgGrad, "PoleTypeCd=='ZZ' && ExtrnWlTypeCd=='ZZ' && RoofTypeCd=='ZZ'",true);
        return;
    }
    var PoleTypeCdFilter = eval("div_PoleTypeCd_chk_PoleTypeCd_" + PoleTypeCd).getUserData("userData1");
    var ExtrnWlTypeCdFilter = eval("div_ExtrnWlTypeCd_chk_ExtrnWlTypeCd_" + ExtrnWlTypeCd).getUserData("userData1");
    var RoofTypeCdFilter = eval("div_RoofTypeCd_chk_RoofTypeCd_" + RoofTypeCd).getUserData("userData1");

    var sFilter = "PoleTypeCd==" + (PoleTypeCdFilter) + " && ExtrnWlTypeCd==" + (ExtrnWlTypeCdFilter) + " && RoofTypeCd==" + (RoofTypeCdFilter);
    wconv.filter(ds_BuldgGrad, sFilter, true);    

    util.setCompBindRefresh("ds_BuldgGrad");
	util.setRowPosition(ds_BuldgGrad, 0);	

}; //========================================================//
